class Solution {
public:
    int maxOperations(string s) {
        char temp='0';
        int count1=0;
        int ans=0;
        for(int i=0;i<s.size();i++) {
            if(s[i]=='0' && temp=='1') {temp='0';ans+=count1;}
            else if(s[i]=='1') {count1++;temp='1';}
        }
        return ans;
    }
};
